import React, { useState } from 'react';

const SimpleRUSE = () => {
  const [showOnboarding, setShowOnboarding] = useState(true);

  const OnboardingFlow = () => (
    <div style={{ 
      minHeight: '100vh', 
      background: 'linear-gradient(135deg, #8B5CF6, #3B82F6, #6366F1)',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      padding: '16px'
    }}>
      <div style={{
        backgroundColor: 'white',
        borderRadius: '24px',
        boxShadow: '0 25px 50px -12px rgba(0, 0, 0, 0.25)',
        padding: '32px',
        maxWidth: '400px',
        width: '100%',
        textAlign: 'center'
      }}>
        <div style={{
          background: 'linear-gradient(135deg, #8B5CF6, #3B82F6)',
          padding: '12px',
          borderRadius: '16px',
          display: 'inline-block',
          marginBottom: '16px'
        }}>
          âš¡
        </div>
        <h1 style={{ 
          fontSize: '24px', 
          fontWeight: 'bold', 
          color: '#111827', 
          marginBottom: '8px' 
        }}>
          Welcome to RUSE
        </h1>
        <p style={{ color: '#6B7280', marginBottom: '24px' }}>
          Discover amazing youth programs in Seattle
        </p>
        <button
          onClick={() => setShowOnboarding(false)}
          style={{
            width: '100%',
            background: 'linear-gradient(135deg, #8B5CF6, #3B82F6)',
            color: 'white',
            padding: '12px',
            borderRadius: '12px',
            fontWeight: '600',
            border: 'none',
            cursor: 'pointer'
          }}
        >
          Get Started
        </button>
      </div>
    </div>
  );

  const MainApp = () => (
    <div style={{ 
      minHeight: '100vh', 
      background: 'linear-gradient(135deg, #F3E8FF, #DBEAFE, #E0E7FF)',
      padding: '16px'
    }}>
      <div style={{
        backgroundColor: 'white',
        borderRadius: '16px',
        boxShadow: '0 10px 25px -5px rgba(0, 0, 0, 0.1)',
        padding: '24px',
        maxWidth: '400px',
        margin: '0 auto',
        textAlign: 'center'
      }}>
        <h1 style={{ 
          fontSize: '20px', 
          fontWeight: 'bold', 
          color: '#111827', 
          marginBottom: '16px' 
        }}>
          RUSE Youth Platform
        </h1>
        <p style={{ color: '#6B7280', marginBottom: '24px' }}>
          App is working! ðŸŽ‰
        </p>
        <div style={{
          background: 'linear-gradient(135deg, #8B5CF6, #3B82F6)',
          color: 'white',
          padding: '12px',
          borderRadius: '12px',
          fontWeight: '600'
        }}>
          âœ… Preview page is now working
        </div>
      </div>
    </div>
  );

  return showOnboarding ? <OnboardingFlow /> : <MainApp />;
};

export default SimpleRUSE;
